import React from 'react'
import styled from 'styled-components'
import logo from '../../asset/images/logo.png'
import MoreVertIcon from "@mui/icons-material/MoreVert";
import UploadFileRoundedIcon from '@mui/icons-material/UploadFileRounded';
import TextSnippetRoundedIcon from '@mui/icons-material/TextSnippetRounded';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';

    const HeaderContainer = styled.div`
      background: #f44336;
      display: flex;
      height: 100%;
      width: 100%;
      align-items: center;
      padding: 10px 0;
      justify-content: space-between;
    `;
    const Header_Lefl = styled.div`
        display: flex;
        padding: 5px;
    `
    const Header_Logo = styled.div`
        img{
            height: 30px;
            width: 30px;
        }
    `
    const Title = styled.div`
        color: white;
        font-size: 20px;
        font-weight: 500;
        margin-left: 5px;
    `
    const HeaderRight = styled.div`
        display: flex;
        margin-right: 15px;
    `
    const SelectLangueNav = styled.div`
        display: flex;
`

const IconLangue = styled.div`
        color: white;
        padding-right: 5px;
`
const TextLangue = styled.div`
    color: white;
    font-size: 15px;
`

const IconSelect = styled.div`
    color: white;
    `;
const SelectBackgroundColorNav = styled.div`
color: white;
    
`;


const Header = () => {


  return (
    <HeaderContainer>
    
        <Header_Lefl>
            <Header_Logo>
                <img src={`${logo}`} />
            </Header_Logo>
            <Title>TimeSheet</Title>
        </Header_Lefl>
        <HeaderRight>
            <SelectLangueNav>
                <IconLangue>
                    <UploadFileRoundedIcon />
                </IconLangue>
                <IconLangue>
                    <TextSnippetRoundedIcon  />
                </IconLangue>
                
                <TextLangue>
                    English
                </TextLangue>
                <IconSelect>
                    <ArrowDropDownIcon />
                </IconSelect>

            </SelectLangueNav>
            <SelectBackgroundColorNav>

                <MoreVertIcon />

            </SelectBackgroundColorNav>
        </HeaderRight>
    </HeaderContainer>
  )
}

export default Header
